import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { OnboardingState } from '../../data/onboardingTypes';
import { Welcome } from './steps/Welcome';
import { Goals } from './steps/Goals';
import { Timeline } from './steps/Timeline';
import { Comfort } from './steps/Comfort';
import { Finish } from './steps/Finish';
import './Onboarding.css';

type OnboardingStep = 'welcome' | 'goals' | 'timeline' | 'comfort' | 'finish';

const stepOrder: OnboardingStep[] = ['welcome', 'goals', 'timeline', 'comfort', 'finish'];

export function Onboarding() {
  const [currentStep, setCurrentStep] = useState<OnboardingStep>('welcome');
  const [data, setData] = useState<OnboardingState>({ mainGoals: [] });
  const navigate = useNavigate();

  const update = <K extends keyof OnboardingState>(key: K, value: OnboardingState[K]) =>
    setData(prev => ({ ...prev, [key]: value }));

  const currentStepIndex = stepOrder.indexOf(currentStep);
  const isFirstStep = currentStepIndex === 0;
  const isLastStep = currentStepIndex === stepOrder.length - 1;

  const handleNext = () => {
    if (isLastStep) {
      navigate('/');
    } else {
      const nextStep = stepOrder[currentStepIndex + 1];
      setCurrentStep(nextStep);
    }
  };

  const handleBack = () => {
    if (!isFirstStep) {
      const prevStep = stepOrder[currentStepIndex - 1];
      setCurrentStep(prevStep);
    }
  };

  const handleSkip = () => {
    navigate('/');
  };

  const renderCurrentStep = () => {
    switch (currentStep) {
      case 'welcome':
        return <Welcome />;
      case 'goals':
        return <Goals />;
      case 'timeline':
        return <Timeline />;
      case 'comfort':
        return <Comfort />;
      case 'finish':
        return <Finish />;
      default:
        return <Welcome />;
    }
  };

  return (
    <div className="onboarding">
      <div className="onboarding-content">
        {renderCurrentStep()}
      </div>
      
      <div className="onboarding-actions">
        <div className="action-buttons">
          {!isFirstStep && (
            <button className="action-button secondary" onClick={handleBack}>
              Back
            </button>
          )}
          
          <button className="action-button secondary" onClick={handleSkip}>
            Skip
          </button>
          
          <button className="action-button primary" onClick={handleNext}>
            {isLastStep ? 'Finish' : 'Next'}
          </button>
        </div>
      </div>
    </div>
  );
}
